    function get_payments_info(){
        $.post(
            'inversapi/api.php',
            {params: {intCodCuenta: cod_cuenta}, 'function': 'ObtenerMovimientosCuentaVirtualPorCuentaSinMovimientosCompensados'},
            function(movs) {
                movements_info = JSON.parse(movs);
                get_movements_stats();
                $('#movements_stats button').remove();
            }, 'json');
    }

    function get_movements_stats(){
        let movements_stats = [];

        movements_info.forEach(function(movement){
            let company = invoicecodes[movement.COD_PRESTAMO];

            if(company != null){

                (movements_stats[company]) ? true : movements_stats[company] = {};
                movements_stats[company].company = company;

                if(!movements_stats[company][movement.TIPO_MOV]){
                    movements_stats[company][movement.TIPO_MOV] = {};
                    movements_stats[company][movement.TIPO_MOV].count = 0;
                    movements_stats[company][movement.TIPO_MOV].cash = 0;
                }

                movements_stats[company][movement.TIPO_MOV].count += 1;

                switch(movement.TIPO_MOV){
                    case 'INVERSIÓN EN PROYECTO':
                    case 'ABONO DE CUOTA':
                    case 'COBRO ATRASADO':
                    case 'VENTA PARTICIP. PROYECTO':
                    case 'COMPRA PARTICIP. PROYECTO':
                        movements_stats[company][movement.TIPO_MOV].cash += Math.abs(movement.IMPORTE_TOTAL);
                        break;
                    case 'LIQUIDACIÓN INTERESES':
                        movements_stats[company][movement.TIPO_MOV].cash += movement.INTERESES;
                        break;
                    default:
                        break;
                }
            }
        })

        generate_table_movements_stats(movements_stats);
    }

    function get_stat(stat, what){
        if(stat == null){
            return '';
        }else{
            if(what == 'cash'){
                return stat[what].toFixed(2);
            }else{
                return stat[what];
            }
        }
    }

    function generate_table_movements_stats(movements_stats){
        let $movements_stats = $('#movements_stats')
        let table_string = '<table data-sort-name="Librado"><thead><tr><th data-sortable="true" data-field="Librado">Librado</th><th title="Inversiones" data-sortable="true">Inv(nº)</th><th title="Inversiones" data-sortable="true">Inv(€)</th><th title="Puntuales" data-sortable="true">Pun(nº)</th><th title="Puntuales" data-sortable="true">Pun(€)</th><th title="Atrasados" data-sortable="true">Atr(nº)</th><th title="Atrasados" data-sortable="true">Atr(€)</th><th title="Intereses" data-sortable="true">Int(€)</th><th title="Venta secundario" data-sortable="true">V.Sec(nº)</th><th title="Venta secundario" data-sortable="true">V.Sec(€)</th><th title="Puntualidad" data-sortable="true">Pun.(%)</th></thead><tbody>';

        Object.keys(movements_stats).forEach(function(key) {
            table_string += '<tr>';
            table_string += '<td>'+ key +'</td>';

            let inversion_en_proyecto_numero = parseInt(get_stat(movements_stats[key]['INVERSIÓN EN PROYECTO'], 'count'));
            let inversion_en_proyecto_cash = parseInt(get_stat(movements_stats[key]['INVERSIÓN EN PROYECTO'], 'cash'));
            let compra_secundario_numero = parseInt(get_stat(movements_stats[key]['COMPRA PARTICIP. PROYECTO'], 'count'));
            let compra_secundario_cash = parseInt(get_stat(movements_stats[key]['COMPRA PARTICIP. PROYECTO'], 'cash'));

            if(compra_secundario_numero && compra_secundario_cash){
                inversion_en_proyecto_numero = parseInt(get_stat(movements_stats[key]['INVERSIÓN EN PROYECTO'], 'count')) + compra_secundario_numero;
                inversion_en_proyecto_cash = parseInt(get_stat(movements_stats[key]['INVERSIÓN EN PROYECTO'], 'cash')) + compra_secundario_cash;
            }

            table_string += '<td class="text-center">'+ inversion_en_proyecto_numero +'</td>';
            table_string += '<td class="text-right">'+ inversion_en_proyecto_cash.toFixed(2) +'</td>';
            table_string += '<td class="text-center">'+ get_stat(movements_stats[key]['ABONO DE CUOTA'], 'count')+'</td>';
            table_string += '<td class="text-right">'+ get_stat(movements_stats[key]['ABONO DE CUOTA'], 'cash')+'</td>';
            table_string += '<td class="text-center">'+ get_stat(movements_stats[key]['COBRO ATRASADO'], 'count')+'</td>';
            table_string += '<td class="text-right">'+ get_stat(movements_stats[key]['COBRO ATRASADO'], 'cash') +'</td>';
            table_string += '<td class="text-right">'+ get_stat(movements_stats[key]['LIQUIDACIÓN INTERESES'], 'cash') +'</td>';
            table_string += '<td class="text-center">'+ get_stat(movements_stats[key]['VENTA PARTICIP. PROYECTO'], 'count')+'</td>';
            table_string += '<td class="text-right">'+ get_stat(movements_stats[key]['VENTA PARTICIP. PROYECTO'], 'cash') +'</td>';

            let puntualidad = '';
            let puntual_numero = (get_stat(movements_stats[key]['ABONO DE CUOTA'], 'count')) ? get_stat(movements_stats[key]['ABONO DE CUOTA'], 'count') : 0;
            let atrasado_numero = (get_stat(movements_stats[key]['COBRO ATRASADO'], 'count')) ? get_stat(movements_stats[key]['COBRO ATRASADO'], 'count') : 0;

            if(puntual_numero && atrasado_numero){
                if(puntual_numero + atrasado_numero == inversion_en_proyecto_numero){
                    puntualidad = ((puntual_numero * 100) / (puntual_numero + atrasado_numero)).toFixed(0);

                    if(puntualidad == '100'){
                        puntualidad = 'TOP';
                    }
                }else{
                    puntualidad = ((puntual_numero * 100) / (puntual_numero + atrasado_numero)).toFixed(0) + '~';
                }
            }else if(puntual_numero){
                puntualidad = ((puntual_numero * 100) / inversion_en_proyecto_numero).toFixed(0);
                if(puntualidad == 100){
                    puntualidad = 'TOP';
                }else{
                    puntualidad += '+';
                }
            }else if(atrasado_numero){
                if(atrasado_numero == inversion_en_proyecto_numero){
                    puntualidad = 0;
                }else{
                    puntualidad = (100 - ((atrasado_numero * 100) / inversion_en_proyecto_numero)).toFixed(0) + '-';
                }
            }

            table_string += '<td class="text-center">'+ puntualidad +'</td>';
            table_string += '</tr>';
        });

        table_string += '</tbody></table>';

        $movements_stats.append(table_string);

        $movements_stats.find('table').bootstrapTable({
            sortable: true,
			search: $('#stats_search'),
			showColumns: true,
            shortName: 'Librado',
			pagination: true,
            sortOrder: 'asc',
			searchAlign: 'left',
			pageSize: 15
		});
    }

    function add_top_information(){
        let $table_toolbar = $('.fixed-table-toolbar:first');

        if($table_toolbar.length){
            $table_toolbar.prepend('<div id="movements_stats" style="clear:both"><button style="float:none !important;font-size:16px;font-weight:normal;float:right;margin:0 0 10px 10px">📈 Mis estadísticas</button></div>');
        }

        let $button_getpaymentsinfo = $table_toolbar.find('#movements_stats button');
        $button_getpaymentsinfo.click(function(){get_payments_info()});
    }

    function process_movements(){
        var $movements = $('#tabla_movimientos:first');

        if($movements.length){
            var $max_pagination = $movements.parent().siblings('.fixed-table-pagination').find('.page-list ul li:last a')
            if($max_pagination){
                $max_pagination.click();
            }

            $movements.find('tbody tr').each(function(){
                let column_movement_type = $movements.find('th[data-field="TIPO_MOV"]:first').index();
                let $movement_type = $(this).find('td:eq('+ column_movement_type +')');
                let movement_type_string = $movement_type.text();
                let movement_type_firstword = movement_type_string.substr(0, movement_type_string.indexOf(' ')).toLowerCase();

                switch(movement_type_firstword){
                    case 'abono':
                        $(this).css('background', '#9EE77D');
                        break;
                    case 'venta':
                        $(this).css('background', '#E7C6F5');
                        break;
                    case 'cobro':
                        var column_interest = $movements.find('th[data-field="INTERESES"]').index();
                        var interest = $(this).find('td:eq('+ column_interest +')').text().split('€');
                        $(this).css('background', '#6AD15F');
                        break;
                    case 'p2p':
                        $(this).css('background', '#6575E4');
                        break;
                    case 'carga':
                        $(this).css('background', '#C6CCF5');
                        break;
                    case 'liquidación':
                        $(this).css('background', '#D5F6C6');
                        break;
                    case 'inversión':
                        $(this).css('background', '#F6D2C6');
                        break;
                    case 'bloqueo':
                        $(this).css('background', '#F6D2C6');
                        break;
                    case 'retirada':
                        $(this).css('background', '#D05F5F');
                        $(this).css('color', '#fff');
                        $(this).find('span').css('color', '#fff');
                        break;
                }

                var code = movement_type_string.match(/\(P([0-9]*)\)/);

                if(code){
                    var code_string = code[0];
                    code = code[1];

                    if(invoicecodes[code]){
                        $movement_type.html('<span style="font-size:0.9em">'+movement_type_string.replace(code_string, ' | <i style="font-size:0.8em"><attr title="'+code+'">' + invoicecodes[code] + '</attr></i></span>'));
                    }
                }
            });

            table_pagination();

            setTimeout(function(){
                window.scrollTo(0, 0);
                $('.ps-container').scrollTop(-300);
            }, 1000);
        }else{
            console.log('ERROR: No se ha encontrado la tabla de movimientos');
        }
    }


    function on_table_ready(){
        add_top_information();

        if($('#tabla_movimientos:first tbody tr').length){
            process_movements();
            table_pagination();
        }else{
           setTimeout(on_table_ready, 50)
        }
    }

    function table_pagination(){
        $('#div_tabla_normal ul.pagination li').click(process_movements);
    }

    function main(){
        if(window.location.pathname == '/movimientos_cuenta_pago.php'){
            on_table_ready()
        }
        add_movements_link_to_main_menu();
    }

    main();

